import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';
import './Skills.css';

const Skills = () => {
    const html = 89;
    const css = 83;
    const bt = 80;
    const js = 75;


    return (
        <div className="skills-section">
            <Container>
                <div className="text-center">
                    <h2 className="title">My Skills</h2>
                </div>
                <Row>
                    <Col md={6}>
                        <h4 style={{ color: '#a5a5a5' }}>Professional Skills</h4>
                        <div className="progressbar-container d-flex">
                            <div className="progressbar-sub-container">
                                <CircularProgressbar className="progressbar" styles={buildStyles({ pathColor: '#4bffa5', trailColor: 'white', textColor: 'white' })} background={false} value={html} text={`${html}%`} />;
                                <h5 style={{ color: '#E86328' }} className="m-0 text-center">HTML</h5>
                            </div>
                            <div className="progressbar-sub-container ms-3">
                                <CircularProgressbar className="progressbar" styles={buildStyles({ pathColor: '#4bffa5', trailColor: 'white', textColor: 'white' })} background={false} value={css} text={`${css}%`} />;
                                <h5 style={{ color: '#254BDD' }} className="m-0 text-center">CSS</h5>
                            </div>
                            <div className="progressbar-sub-container ms-3">
                                <CircularProgressbar className="progressbar" styles={buildStyles({ pathColor: '#4bffa5', trailColor: 'white', textColor: 'white' })} background={false} value={bt} text={`${bt}%`} />;
                                <h5 style={{ color: '#8210F5' }} className="m-0 text-center">Bootstrap</h5>
                            </div>
                            <div className="progressbar-sub-container ms-3">
                                <CircularProgressbar className="progressbar" styles={buildStyles({ pathColor: '#4bffa5', trailColor: 'white', textColor: 'white' })} background={false} value={js} text={`${js}%`} />;
                                <h5 style={{ color: '#EFD81D' }} className="m-0 text-center">JavaScript</h5>
                            </div>
                        </div>
                    </Col>
                    <Col md={6}>

                    </Col>
                </Row>
            </Container>
        </div>
    );
};

export default Skills;
